import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import HomeBody from './homepage';
import MovieList from './movies';
import Podcast from './podcast';

function Nav() {
  return (
    <div className="row">
      <img className="col-1" src="./4746048.png" />
      <div className="col-11">
        <h1> Joel Hilton Movie Site</h1>
        <p>
          <span onClick={Page} style={{ margin: '5px' }}>
            Home
          </span>{' '}
          <span onClick={Page} style={{ margin: '5px' }}>
            My Podcast
          </span>{' '}
          <span onClick={Page} style={{ margin: '5px' }}>
            Movie List
          </span>
        </p>
      </div>
    </div>
  );
}

function Page() {
  const [body, setBody] = useState(
    <>
      <Podcast />
    </>
  );

  return body;
}

function movie() {
  return (
    <div>
      <Nav />
      <MovieList />
    </div>
  );
}

function podcast() {
  var shoot = () => {
    <div>
      <Nav />
      <Podcast />
    </div>;
  };
  return shoot;
}

function App() {
  return (
    <>
      <Nav />
      <Page />
    </>
  );
}

export default App;
